.card {
  font-family: arial;
  font-size: 14px;
  text-align: center;
  color: black;
  background-color: white;
  align: center
}

.titre{
  font-size: 16px;
}

.objets{
  font-size: 10px;
}

.fiche {
  position:absolute;
  width: calc(100% - 6em);
  max-height: calc(100% - 7em);
  left: 1em;
  top: 1em;
  overflow-x: auto;
  z-index: 0;
  %display: inline-block;
  border: 4px solid #89D39D;
  border-radius: 8px;
  padding: 1em 1em 1em 1em;
  margin: 1em
}

.echologo {
  height:3em;
  z-index: 1;
  position:absolute;
  left:10px;
  top:19px
}

.licence {
  position:absolute;
  right: 2em;
  bottom: 1em
